      }

      &.md-disabled {
        &:after {
          background-image: linear-gradient(to right, rgba(#000, .38) 0%, rgba(#000, .38) 33%, transparent 0%);
        }

        label,
        .md-input,
        .md-textarea {
          color: rgba(#000, .42);
        }
      }
    } @else {
      &:after {
        background-color: rgba(#fff, .7);
      }

      &:before {
        @include md-theme-property(background-color, primary);
      }

      .md-helper-text,
      .md-count,
      label {
        color: rgba(#fff, .7);
      }

      .md-suffix, .md-prefix {
        color: rgba(#fff, .7);
      }

      .md-input,
      .md-textarea {
        &::-webkit-input-placeholder {
          color: rgba(#fff, .7);
        }
      }

      &.md-focused,
      &.md-has-value {
        .md-input,
        .md-textarea {
          -webkit-text-fill-color: #fff;
        }
      }

      &.md-has-textarea:not(.md-autogrow) {
        &:after {
          border-color: #fff;
        }

        &:before {
          @include md-theme-property(border-color, primary);
        }
      }

      &.md-disabled {
        &:after {
          background-image: linear-gradient(to right, rgba(#fff, .7) 0%, rgba(#fff, .7) 33%, transparent 0%);
        }

        label,
        .md-input,
        .md-textarea {
          color: rgba(#fff, .5);
        }
      }
    }

    > .md-icon {
      &:after {
        @include md-theme-property(background-color, background-variant);
      }
    }

    &.md-invalid {
      &:after {
        @include md-theme-property-by-hue(background-color, red, A400, field, error);
      }

      &.md-has-textarea:not(.md-autogrow) {
        &:before {
          @include md-theme-property-by-hue(border-color, red, A400, field, error);
        }
      }

      label {
        @include md-theme-property-by-hue(color, red, A400, field, error);
      }

      .md-error {
        @include md-theme-property-by-hue(color, red, A400, field, error);
      }

      .md-date-icon,
      .md-date-icon svg {
        @include md-theme-property-by-hue(color, red, A400, field, error);
        @include md-theme-property-by-hue(fill, red, A400, field, error);
      }
    }

    &.md-focused,
    &.md-highlight {
      .md-input,
      .md-textarea {
        @include md-theme-property(color, primary, background);
      }

      > .md-icon {
        @include md-theme-property(color, primary, background);
        @include md-theme-property(fill, primary, background);
      }
    }

    &.md-focused {
      label {
        @include md-theme-property(color, primary, background);
      }
    }

    &.md-disabled {
      .md-icon svg {
        @include md-theme-property(fill, disabled, background);
      }
    }
  }
}

.md-icon {
  @include md-theme-component() {
    &.md-icon-image {
      svg {
        @include md-theme-property(fill, icon, background);

        &.md-primary {
          @include md-theme-property(fill, primary, background);
        }

        &.md-accent {
          @include md-theme-property(fill, accent, background);
        }
      }
    }

    &.md-icon-font {
      @include md-theme-property(color, icon, background);

      &.md-primary {
        @include md-theme-property(color, primary, background);
      }

      &.md-accent {
        @include md-theme-property(color, accent, background);
      }
    }
  }
}

.md-list {
  @include md-theme-component() {
    @include md-theme-property(background-color, background);
    @include md-theme-property(color, text-primary, background);

    &.md-double-line .md-list-item-text :nth-child(2) {
      @include md-theme-property(color, text-accent, background);
    }

    &.md-triple-line .md-list-item-text :nth-child(3) {
      @include md-theme-property(color, text-accent, background);
    }

    .md-highlight .md-list-item-container {
      @include md-theme-property(background-color, divider, background);
    }

    .md-list-item-container {
      @include md-theme-property(color, text-primary, background);

      &:not(.md-list-item-default):not(.md-list-item-expand):not([disabled]):hover {
        @include md-theme-property(background-color, divider, background);
        @include md-theme-property(color, text-primary, background);
      }
    }

    [disabled] {
      @include md-theme-property(color, disabled, background);
    }

    .md-selected,
    .router-link-active {
      .md-list-item-content {
        @include md-theme-property(color, primary, background);
      }
    }

    .md-list-item-expand {
      &.md-active {
        @include md-theme-property(border-color, divider, background);
      }

      &:not(.md-list-item-default):not([disabled]) {
        > .md-list-item-content:hover {
          @include md-theme-property(background-color, divider, background);
          @include md-theme-property(color, text-primary, background);
        }
      }
    }
  }
}

@mixin md-menu-item-spec ($color) {
  .md-list-item-link,
  .md-list-item-router,
  .md-list-item-button {
    @include md-theme-property(color, $color, background);
  }
}

.md-menu-item {
  @include md-theme-component() {
    &.md-primary {
      @include md-menu-item-spec(primary);
    }

    &.md-accent {
      @include md-menu-item-spec(accent);
    }
  }
}

@mixin md-progress-bar-indeterminate ($hue) {
  @include md-theme-property(background-color, $hue, null, .38);

  .md-progress-bar-track,
  .md-progress-bar-fill {
    &:after {
      @include md-theme-property(background-color, $hue);
    }
  }
}

@mixin md-progress-bar-determinate ($hue) {
  @include md-theme-property(background-color, $hue, null, .38);

  .md-progress-bar-fill {
    @include md-theme-property(background-color, $hue);
  }
}

@mixin md-progress-bar-buffer ($hue) {
  .md-progress-bar-fill {
    @include md-theme-property(background-color, $hue);
  }

  .md-progress-bar-track {
    @include md-theme-property(background-color, $hue, null, .38);
  }

  .md-progress-bar-buffer {
    @include md-theme-property(border-color, $hue, null, .38);
  }
}

@mixin md-progress-spinner-spec ($hue) {
  .md-progress-spinner-circle {
    @include md-theme-property(stroke, $hue);
  }
}

.md-progress-bar {
  @include md-theme-component() {
    &.md-indeterminate,
    &.md-query {
      @include md-progress-bar-indeterminate(primary);

      &.md-accent {
        @include md-progress-bar-indeterminate(accent)
      }
    }

    &.md-determinate {
      @include md-progress-bar-determinate(primary);

      &.md-accent {
        @include md-progress-bar-determinate(accent)
      }
    }

    &.md-buffer {
      @include md-progress-bar-buffer(primary);

      &.md-accent {
        @include md-progress-bar-buffer(accent)
      }
    }
  }
}

.md-progress-spinner {
  @include md-theme-component() {
    @include md-progress-spinner-spec(primary);

    &.md-accent {
      @include md-progress-spinner-spec(accent)
    }
  }
}

.md-radio {
  @include md-theme-component() {
    &.md-checked {
      .md-radio-container {
        @include md-theme-property(border-color, accent);

        &:after {
          @include md-theme-property(background-color, accent);
        }
      }

      .md-ripple {
        @include md-theme-property(color, accent);
      }
    }

    &.md-checked.md-primary {
      .md-radio-container {
        @include md-theme-property(border-color, primary);

        &:after {
          @include md-theme-property(background-color, primary);
        }
      }

      .md-ripple {
        @include md-theme-property(color, primary);
      }
    }

    @if md-get-theme-mode() == light {
      .md-radio-container {
        border-color: rgba(#000, .54);
      }

      &.md-disabled {
        .md-radio-container {
          border-color: rgba(#000, .26);
        }

        &.md-checked {
          .md-radio-container {
            border-color: rgba(#000, .26);

            &:after {
              background-color: rgba(#000, .26);
            }
          }
        }
      }
    } @else {
      .md-radio-container {
        border-color: rgba(#fff, .7);
      }

      &.md-disabled {
        .md-radio-container {
          border-color: rgba(#fff, .3);
        }

        &.md-checked {
          .md-radio-container {
            border-color: rgba(#fff, .3);

            &:after {
              background-color: rgba(#fff, .3);
            }
          }
        }
      }
    }
  }
}

.md-snackbar {
  @include md-theme-component() {
    @include md-theme-property(color, text-primary, text-primary);

    @if md-get-theme-mode() == light {
      background-color: #323232;
    } @else {
      background-color: #fff;
    }
  }
}

.md-steppers {
  @include md-theme-component() {
    @include md-theme-property(background-color, background);
    @include md-theme-property(color, text-primary, background);


    .md-stepper-icon,
    .md-stepper-number,
    .md-stepper {
      &:after,
      &:before {
        @include md-theme-property(background-color, divider, background);
      }
    }

    .md-stepper-number {
      @include md-theme-property(background-color, text-hint, background);
      @include md-theme-property(color, text-primary, text-hint);

      svg {
        @include md-theme-property(color, text-primary, text-hint);
        @include md-theme-property(fill, text-primary, text-hint);
      }
    }

    .md-stepper-header {
      .md-button-content {
        @include md-theme-property(color, text-hint, background);

        &:after,
        &:before {
          @include md-theme-property(background-color, divider, background);
        }
      }

      &.md-active,
      &.md-done {
        .md-button-content {
          @include md-theme-property(color, text-primary, background);
        }

        .md-stepper-number {
          @include md-theme-property(background-color, primary, background);
          @include md-theme-property(color, text-primary, primary);

          svg {
            @include md-theme-property(color, text-primary, primary);
            @include md-theme-property(fill, text-primary, primary);
          }
        }
      }

      &.md-error {
        .md-button-content {
          @include md-theme-property-by-hue(color, red, A400, stepper, error);
        }

        .md-icon svg {
          @include md-theme-property-by-hue(color, red, A400, stepper, error);
          @include md-theme-property-by-hue(fill, red, A400, stepper, error);
        }
      }
    }
  }
}

.md-subheader {
  @include md-theme-component() {
    @include md-theme-property(color, text-accent, background);

    &.md-primary {
      @include md-theme-property(color, primary, background);
    }
  }
}

.md-switch {
  @include md-theme-component() {
    &.md-checked {
      .md-switch-container {
        @include md-theme-property(background-color, accent, null, .38);
      }

      .md-switch-thumb {
        @include md-theme-property(background-color, accent);
      }

      .md-ripple {
        @include md-theme-property(color, accent);
      }
    }

    &.md-checked.md-primary {
      .md-switch-container {
        @include md-theme-property(background-color, primary, null, .38);
      }

      .md-switch-thumb {
        @include md-theme-property(background-color, primary);
      }

      .md-ripple {
        @include md-theme-property(color, primary);
      }
    }

    @if md-get-theme-mode() == light {
      .md-switch-container {
        background-color: rgba(#000, .38);
      }

      .md-switch-thumb {
        @include md-theme-property-by-hue(background-color, grey, 100, switch, thumb);
      }

      &.md-disabled {
        .md-switch-container {
          background-color: rgba(#000, .12);
        }

        .md-switch-thumb {
          @include md-theme-property-by-hue(background-color, grey, 400, switch, thumb);
        }
      }
    } @else {
      .md-switch-container {
        background-color: rgba(#fff, .3);
      }

      .md-switch-thumb {
        @include md-theme-property-by-hue(background-color, grey, 400, switch, thumb);
      }

      &.md-disabled {
        .md-switch-container {
          background-color: rgba(#fff, .1);
        }

        .md-switch-thumb {
          @include md-theme-property-by-hue(background-color, grey, 800, switch, thumb);
        }
      }
    }
  }
}

.md-table {
  @include md-theme-component() {
    .md-table-content,
    .md-table-alternate-header {
      @include md-theme-property(background-color, background);
    }

    .md-table-alternate-header .md-table-toolbar {
      @include md-theme-property(color, text-primary, background);
      @include md-theme-property(background-color, accent, null, .2);
    }

    .md-table-row {
      &:hover:not(.md-header-row) .md-table-cell {
        @include md-theme-property(background-color, highlight, background, .08);
      }

      &.md-selected,
      &.md-selected-single {
        @if md-get-theme-mode() == light {
          @include md-theme-property-by-hue(background-color, grey, 100, row, background);
        } @else {
          @include md-theme-property-by-hue(background-color, grey, 700, row, background);
        }

        &.md-primary {
          @include md-theme-property(background-color, primary, background);
          @include md-theme-property(color, text-primary, primary);

          .md-ripple {
            color: #fff;
          }

          .md-checkbox-container {
            background-color: #fff;
            border-color: #fff;

            &:after {
              @include md-theme-property(border-color, primary);
            }
          }
        }

        &.md-accent {
          @include md-theme-property(background-color, accent, background);
          @include md-theme-property(color, text-primary, accent);

          .md-ripple {
            color: #fff;
          }

          .md-checkbox-container {
            background-color: #fff;
            border-color: #fff;

            &:after {
              @include md-theme-property(border-color, accent);
            }
          }
        }
      }

      td {
        @include md-theme-property(border-top-color, divider, background);
      }
    }

    .md-table-head {
      @include md-theme-property(color, text-accent, background);
    }

    .md-table-fixed-header-active {
      @include md-theme-property(border-bottom-color, divider, background);
    }

    .md-sortable {
      &:hover,
      &.md-sorted {
        @include md-theme-property(color, text-primary, background);

        svg {
          @include md-theme-property(color, text-primary, background);
          @include md-theme-property(fill, text-primary, background);
        }
      }
    }

    .md-table-pagination {
      @include md-theme-property(border-top-color, divider, background);
    }
  }
}

@mixin md-tabs-spec ($primary, $indicator, $text) {
  .md-tabs-navigation {
    @include md-theme-property(background-color, $primary, background);

    .md-button {
      @if $text == text-primary {
        @include md-theme-property(color, $text, $primary, .7);

        &[disabled] {
          @include md-theme-property(color, $text, $primary, .38);
        }

        .md-icon {
          @include md-theme-property(color, $text, $primary, .7);

          svg {
            @include md-theme-property(fill, $text, $primary, .7);
          }
        }
      } @else {
        @include md-theme-property(color, text-primary, $primary, .7);

        &[disabled] {
          @include md-theme-property(color, text-primary, $primary, .38);
        }

        .md-icon {
          @include md-theme-property(color, text-primary, $primary, .7);

          svg {
            @include md-theme-property(fill, text-primary, $primary, .7);
          }
        }
      }

      &.md-active {
        @include md-theme-property(color, $text, $primary);

        .md-icon {
          @include md-theme-property(color, $text, $primary);

          svg {
            @include md-theme-property(fill, $text, $primary);
          }
        }
      }
    }
  }

  .md-tabs-indicator {
    @include md-theme-property(background-color, $indicator, $primary);
  }
}

.md-tabs {
  @include md-theme-component() {
    @include md-tabs-spec(background, primary, primary);

    &.md-primary {
      @include md-tabs-spec(primary, text-primary, text-primary);
    }

    &.md-accent {
      @include md-tabs-spec(accent, text-primary, text-primary);
    }
  }
}

@mixin md-toolbar-icon($primary, $secondary) {
  .md-icon {
    @include md-theme-property(color, $primary, $secondary);

    svg {
      @include md-theme-property(fill, $primary, $secondary);
    }
  }
}

@mixin md-toolbar-button($primary, $secondary) {
  .md-button:not([disabled]) {
    &:not(.md-raised) {
      @include md-theme-property(color, $primary, $secondary);
    }
  }
}

@mixin md-toolbar-title($primary, $secondary) {
  .md-title,
  .md-display-1,
  .md-display-2 {
    @include md-theme-property(color, $primary, $secondary);
  }
}

.md-toolbar {
  @include md-theme-component() {
    @include md-theme-property(color, text-primary, background-variant);

    @if md-get-theme-mode() == light {
      @include md-theme-property-by-hue(background-color, grey, 100, toolbar, background);
    } @else {
      @include md-theme-property-by-hue(background-color, grey, 900, toolbar, background);
    }

    @include md-toolbar-icon(text-primary, background-variant);
    @include md-toolbar-title(text-primary, background-variant);

    &.md-primary {
      @include md-theme-property(background-color, primary);
      @include md-theme-property(color, text-primary, primary);
      @include md-toolbar-icon(text-primary, primary);
      @include md-toolbar-button(text-primary, primary);
      @include md-toolbar-title(text-primary, primary);
    }

    &.md-accent {
      @include md-theme-property(background-color, accent);
      @include md-theme-property(color, text-primary, accent);
      @include md-toolbar-icon(text-primary, accent);
      @include md-toolbar-button(text-primary, accent);
      @include md-toolbar-title(text-primary, accent);
    }

    &.md-transparent {
      background-color: transparent;
      @include md-theme-property(color, text-primary, background);
      @include md-toolbar-icon(text-primary, background);
      @include md-toolbar-title(text-primary, background);
    }
  }
}

.md-badge {
  @include md-theme-component() {
    @include md-theme-property(color, text-primary, accent);
    @include md-theme-property(background-color, accent);

    &.md-primary {
      @include md-theme-property(color, text-primary, primary);
      @include md-theme-property(background-color, primary);
    }
  }
}

